import ReactDOM from 'react-dom'
import App from './App'
import axios from 'axios'

const promise = axios.get('http://localhost:3001/notes')

promise.then(response => {
    const notes = response.data
    ReactDOM.render(
        <App notes={notes}/>,
        document.getElementById('root')
    )
})
